// MainContent.js
import React from 'react';
import { useNavigate } from 'react-router-dom';

const MainContent = () => {
  const navigate = useNavigate();

  return (
    <div className="flex flex-col items-center justify-center h-full p-4">
      <button
        className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded m-2"
        onClick={() => navigate('/go-live')}
      >
        Go Live
      </button>
      <button
        className="bg-indigo-500 hover:bg-indigo-700 text-white font-bold py-2 px-4 rounded m-2"
        onClick={() => navigate('/profile')} // This assumes you want the "Update Profile" button to go to the Profile component
      >
        Update Profile
      </button>
      <button
        className="bg-purple-500 hover:bg-purple-700 text-white font-bold py-2 px-4 rounded m-2"
        onClick={() => navigate('/watch-previous-incidents')}
      >
        Watch Previous Incidents
      </button>
    </div>
  );
};

export default MainContent;
